import React from 'react';
import './CSS/Etlap.css';
import { Termekek } from '../../Termekek';

const Etlap = () => {
  
  return (
    <div className='Etlap'>
     
     
        <div className='etel-title'>
          
        </div>

        <div className='termekek'>
        {Termekek.map((termek) => <Product/>)}
        </div>
      
      <footer className='footer1'>
        <p>&copy; {new Date().getFullYear()} FoodRapid. Minden jog fenntartva.</p>
        <p>Kövess minket a közösségi médiában!</p>
      </footer>
    </div>
  );
};

export default Etlap;
